                    <div>
                    <Link to={`/appointments/editappointment/${this.props.appointment.id}`}>Edit</Link>
                    <p>Date: {this.props.appointment.date}</p>
                    <p>Time: {this.props.appointment.time}</p>
                    <p>Reason: {this.props.appointment.reason}</p>
                    </div>





                        {/* <h6>Date:</h6>
